import React from "react";
import { Index, Table as VirtualizedTable, TableProps } from "react-virtualized";
import TableColunm from "./TableColunm";
import 'react-virtualized/styles.css'

interface IProps extends TableProps{
    columns: JSX.Element[]
    getRow: (info: Index) => any
}

const Table: React.FC<IProps> = (props) =>{
    const {columns, getRow} = props

   

    return(
        <VirtualizedTable rowGetter={getRow} noRowsRenderer={() => (<div></div>)} {...props}>
            {TableColunm({dataKey: "id", width: 50, headerValue: "ID"})}
            {TableColunm({dataKey: "type", width: 200, headerValue: "TYPE"})}
            {TableColunm({dataKey: "message", width: 400, headerValue: "ERROR"})}
        </VirtualizedTable>
    )
} 

export default Table
